import React from 'react';
import Modal from 'react-modal';

const AddProjectModal = ({ isOpen, onRequestClose, onSubmit, project, setProject, isEditing }) => {
  return (
    <Modal
      isOpen={isOpen}
      onRequestClose={onRequestClose}
      contentLabel={isEditing ? "Edit Project" : "Add New Project"}
      className="Modal"
      overlayClassName="Overlay"
    >
      <h2>{isEditing ? "Edit Project" : "Add New Project"}</h2>
      <form onSubmit={onSubmit}>
        <div className="form-group">
          <label htmlFor="projectName">Name</label>
          <input
            type="text"
            id="projectName"
            className="form-control"
            placeholder="Enter project name"
            value={project.name}
            onChange={(e) => setProject({ ...project, name: e.target.value })}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="projectClient">Client</label>
          <input
            type="text"
            id="projectClient"
            className="form-control"
            placeholder="Enter client name"
            value={project.client}
            onChange={(e) => setProject({ ...project, client: e.target.value })}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="startDate">Start Date</label>
          <input
            type="date"
            id="startDate"
            className="form-control"
            value={project.startDate}
            onChange={(e) => setProject({ ...project, startDate: e.target.value })}
          />
        </div>
        <div className="form-group">
          <label htmlFor="endDate">End Date</label>
          <input
            type="date"
            id="endDate"
            className="form-control"
            value={project.endDate}
            onChange={(e) => setProject({ ...project, endDate: e.target.value })}
          />
        </div>
        <div className="modal-footer">
          <button type="button" className="btn btn-secondary" onClick={onRequestClose}>Close</button>
          <button type="submit" className="btn btn-primary">{isEditing ? "Save Changes" : "Add Project"}</button>
        </div>
      </form>
    </Modal>
  );
};

export default AddProjectModal;
